import React from 'react'
import styles from './NominateYourself.module.css'

const NominateYourself = (props) => {
  return (
    <button className={styles.floatingButton + ' btn btn-warning btn-lg'}>
      Nominate Myself
    </button>
  )
}

export default NominateYourself
